import React from 'react'
import exerciseImg from '../imagenes/exercise.png'
import './styles/card.css'

class Card extends React.Component{
    render(){
        return (
            <div className="card mx-auto Fitness-Card">
                <div className="card-body">
                    <div className="row center">
                        <div className="col-6">
                            <img src={exerciseImg} alt="Ejercicio" className="float-right"/>
                        </div>
                        <div className="col-6 Finess-Card-Info">
                            <h1>Tecnicas Guias</h1>
                            <p>Aprender increibles secretos ejercitadores y calistenicos</p>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
export default Card;
